import React  from "react";
import styled        from 'styled-components';
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import {resturantMenueData} from "../../Data/ResturantMenueData.js";
import "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import { Button } from "../../Components/Button.js";



const CardWrapper =styled.div`
  padding-top: 20%;
  padding-left: 20%;
  background-color: whitesmoke;
  //margin-bottom: 60px;
   // background-color: whitesmoke;
    padding-bottom: 54px;
`;
const ButtonWrapper=styled.div`
padding-left: 30px;

`;

const MenueSlider = () => {
    var settings = {
        dots            : true,
        infinite        : true,
        speed           : 500,
        slidesToShow    : 3,
        slidesToScroll  : 1
        
    };
     
    
    return (
            <Slider {...settings }>
                    {resturantMenueData.map((items,index) => (
                        <div class="container">
                        <div class="row">
                          <div class="col">
                          <CardWrapper >
                            
                            <div class = "card" style={{width: '18rem'}}>
                                <img src = {items.image} class="card-img-top" alt="..." height="200px"/>
                                <div class = "card-body">
                                <h5 class  = "card-title">{items.title}</h5>
                                <p class   = "card-text">{items.Range}</p>
                                <ButtonWrapper>
                                <Button to = '/checkMenue' primary = 'true' >Check Menue</Button>
                                </ButtonWrapper>
                                </div>
                            </div>
                             </CardWrapper>
                          </div>
                        </div>
                      </div>
                    ))}
                   
            </Slider>
            );
}

export default MenueSlider
